export function TheDesignPattern() {
  const [tab, setTab] = useState(tabs[0].label)
  return (
    <div className="flex justify-center">
      <div className="max-w-screen-2xl w-full flex items-start">
        <div>
          <span className="font-bold text-blue-500">ACP Design Pattern</span>
          <p className="text-slate-900 text-4xl tracking-tight font-extrabold sm:text-5xl max-w-[25vw]">
            Abstract<br />
            Compose<br />
            Pack
          </p>
          <p className="max-w-[50ch] my-8 text-lg">
            A modern method of logically organizing any system that uses the
            request/response paradigm. A three point concept thats easily implemented
            in any language.
          </p>
          <HorizontalTabs
            tabs={tabs}
            selected={tab}
            onChange={setTab}
            className="text-blue-600"
            iconClassName="text-blue-500"
          />
          <div className="mt-12">
            <h4 className="text-lg text-slate-900 font-bold mb-2">
              {tabs.find(x => x.label === tab).title}
            </h4>
            {tabs.find(x => x.label === tab).content}
          </div>
        </div>
        <div className="grow flex items-start px-40">
          <svg viewBox="0 0 289 352" fill="none" className="">
            {svg(tab)}
          </svg>
        </div>
      </div>
    </div>
  )
}

